import React, { useState, useEffect } from "react";
import DataTable from 'react-data-table-component';

export default function Cablecom({ url }) { // Utilizando destructuración directamente en los argumentos de la función
    const [data, setData] = useState(null);

    useEffect(() => {
        fetch(url)
            .then(response => response.json())
            .then((data) => setData(data));
    }, [url]); // Asegúrate de incluir 'url' en el arreglo de dependencias

    const columns = [
        {
            name: 'Nombre',
            selector: 'character',
        },
        {
            name: 'Comentario',
            selector: 'quote',
        },
        {
            name: 'Imagen',
            selector: 'image',
        },
        {
            name: 'Orientacion politica',
            selector: 'characterDirection',
        },
    ];

    return (
        <div>
            {data ? ( // Verifica si 'data' tiene datos antes de renderizar DataTable
                <DataTable columns={columns} data={data}/>
            ) : (
                <p>Cargando datos...</p>
            )}
        </div>
    );
}
